INSERT INTO `sportovec` (`idsportovec`, `prijmeni`, `jmeno`, `pohlavi`, `zkratka_statu`, `vyska`, `vaha`, `kariera`, `foto`) VALUES
(4, 'Bolt', 'Usain', 'muž', 'JAM', 1.95, 94, 'Usain Bolt (Usain St. Leo Bolt) (* 21. srpna 1986) je jamajský sprinter, v současnosti držitel tří atletických světových rekordů v prestižním běhu na 100 metrů časem 9,58 s, který zaběhl 16. srpna 2009, běhu na 200 metrů s časem 19,19 s z 20. srpna 2009 a ve štafetě na 4 x 100 metrů časem 36,84 s, kterou zaběhl na LOH 2012 v Londýně. Drží také světový rekord v běhu na neoficiální trati 150 metrů časem 14,35 s. z května roku 2009.\r\nUsain Bolt je prvním člověkem v historii, který dokázal zaběhnout nejkratší trať regulérně pod hranicí 9,70 sekund i 9,60 sekund. Na atletickém MS 2009 v Berlíně byla provedena vědecká analýza Boltova běhu, která ukázala, že ve finále stometrové trati dosáhl maximální rychlosti 44,72 km/h (letmých 20 metrů za 1,61 s.) a průměrné rychlosti 37,58 km/h.[1] V souvislosti s analýzou na OH v Pekingu proběhly spekulace o možném Boltově času na 100 metrů, pokud by závěr stovky nevypustil. Některé odhady hovořily již tehdy o čase 9,64 s., ten však Bolt výrazně překonal v Berlíně[2]. Sám Bolt dal na zmíněném MS v atletice 2009 nejlepší odpověď, když jeho průběhem cíle stometrové tratě byly výrazně překonány dosavadní předpokládané hranice lidských možností časem 9,58 s (překonal svůj vlastní rekord o 0,11 s).\r\nV běhu na 200 metrů dosáhl také velmi výrazného výkonu, když již v Pekingu překonal o 0,02 s famózní rekord Michaela Johnsona z finále OH v Atlantě 1996 časem 19,30 s při průměrné rychlosti 37,30 km/h[3]. Na MS v Berlíně o rok později pak ubral ještě dalších 0,11 s a famózním časem 19,19 s opět překonal světový rekord (přestože běžel do protivětru -0,3 m/s; průměrná rychlost činí 37,52 km/h). První stovku běžel Bolt za 9,92 s., druhou údajně za 9,27 s. Všechny ostatní výkony jsou až na výjimky o zhruba 0,4 sekundy pomalejší (19,58 s a výše). Jamajská štafeta s Boltem na třetím úseku na olympiádě v Pekingu roku 2008 překonala předchozí světový rekord také na trati štafetového běhu 4 x 100 m časem 37,10 s. Bolt výrazně přispěl nejrychlejším časem na svém (3.) úseku za 8,94 s.', );
INSERT INTO `sportovec` (`idsportovec`, `prijmeni`, `jmeno`, `pohlavi`, `zkratka_statu`, `vyska`, `vaha`, `kariera`, `foto`) VALUES
(5, 'Blake', 'Yohan', 'muž', 'JAM', 1.80, 76, 'Yohan Blake (* 26. prosince 1989, Saint James Parish) je jamajský atlet, sprinter.\r\nPrvní mezinárodní úspěchy získal v roce 2006 na juniorském mistrovství světa v Pekingu, kde vybojoval bronzovou medaili v běhu na 100 metrů a zlato ve štafetě na 4×100 metrů.\r\nV roce 2011 vybojoval v jihokorejském Tegu časem 9,92 s titul mistra světa v běhu na 100 metrů, když využil zaváhání svého krajana Usaina Bolta, který byl ve finále za předčasný start diskvalifikován.[1] Na témže šampionátu dopomohl na třetím úseku jamajské štafetě na 4×100 m k novému světovému rekordu 37,04 s.\r\n16. září 2011 při závěrečném mítinku Diamantové ligy v Bruselu zaběhl dvoustovku ve druhém nejlepším času historie 19,26 s. Za světovým rekordem svého krajana Usaina Bolta zaostal o 7 setin sekundy.[2] Na Letních olympijských hrách 2012 v Londýně vybojoval dvě stříbrné medaile v individuálních závodech na 100 a 200 metrů. V obou případech byl rychlejší jen jeho krajan Usain Bolt, se kterým později vybojoval zlatou medaili ve štafetě na 4×100 metrů. Na zlatu se dále podílel Nesta Carter a Michael Frater. Jamajské kvarteto dokázalo poprvé v historii pokořit hranici 37 sekund a časem 36,84 s o 20 setin vylepšilo původní maximum ze světového šampionátu v Tegu v roce 2011.', ),
(6, 'Coutts', 'Alicia', 'žena', 'AUS', 1.79, 76, '', '');
INSERT INTO `sportovec` (`idsportovec`, `prijmeni`, `jmeno`, `pohlavi`, `zkratka_statu`, `vyska`, `vaha`, `kariera`, `foto`) VALUES
(7, 'Phelps', 'Michael', 'muž', 'USA', 1.93, 88, 'Michael Fred Phelps (* 30. června 1985, Baltimore) je americký plavec, který se stal držitelem několika olympijských a sedmi světových rekordů v plavání [1] a je držitelem 22 olympijských medailí, a to 18 zlatých, 2 stříbrných a 2 bronzových.\r\nOsm medailí získal v roce 2004 na letních olympijských hrách v Aténách (šest zlatých, dvě bronzové) a osm v roce 2008 v Pekingu (všechny zlaté). V roce 2012 v Londýně pak 4 zlaté a 2 stříbrné olympijské medaile.\r\nJeho 18 zlatých olympijských medailí a dohromady 22 olympijských medailí celkem představuje historický rekord pro jediného sportovce v celé historii olympijských her. Byl vyhlášen nejlepšim plavcem roku v letech 2003, 2004, 2006, 2007, 2008 a 2009.', );
INSERT INTO `sportovec` (`idsportovec`, `prijmeni`, `jmeno`, `pohlavi`, `zkratka_statu`, `vyska`, `vaha`, `kariera`, `foto`) VALUES
(8, 'Schwarzkopfová', 'Lilli', 'žena', 'GER', 1.73, 65, 'Lilli Schwarzkopfová (* 28. srpna 1983, Novopokrovka, Kyrgyzská SSR) je německá atletka, která se věnuje sedmiboji a halovému pětiboji.\r\nV roce 2005 získala stříbrnou medaili na mistrovství Evropy do 23 let v Erfurtu a o rok později bronzovou medaili na mistrovství Evropy v Göteborgu.\r\nJe trojnásobnou účastnicí mistrovství světa v atletice. Na šampionátu v roce 2005 v Helsinkách obsadila s celkovým počtem 5 993 bodů třináctou pozici. O dva roky později skončila na mistrovství světa v Ósace na pátém místě, když v sedmi disciplínách nasbírala 6 439 bodů. Na světovém šampionátu v Berlíně 2009 závod nedokončila, když do čtvrté disciplíny prvého dne, běhu na 200 metrů již kvůli zranění nezasáhla. Reprezentovala na letních olympijských hrách v Pekingu, kde se umístila na osmém místě.', );
INSERT INTO `sportovec` (`idsportovec`, `prijmeni`, `jmeno`, `pohlavi`, `zkratka_statu`, `vyska`, `vaha`, `kariera`, `foto`) VALUES
(9, 'Špotáková', 'Barbora', 'žena', 'CZE', 1.89, 80, 'Barbora Špotáková (* 30. června 1981 Jablonec nad Nisou, Československo) je česká atletka, závodící v hodu oštěpem, dvojnásobná olympijská vítězka z Letních olympijských 2008 v Pekingu a 2012 v Londýně a členka armádního sportovního centra Dukly Praha. Od 13. září 2008 je také držitelkou světového rekordu v hodu oštěpem (od změny těžiště v roce 1999) v ženské kategorii s výkonem 72,28 metru.Dříve se věnovala také víceboji.\r\nDne 28. října 2012 jí prezident České republiky Václav Klaus vyznamenal Medailí Za zásluhy.', ),
(10, 'Gatlin', 'Justin', 'muž', 'USA', 1.78, 79, '', ''),
(11, 'Obergföll', 'Christina', 'žena', 'GER', 1.75, 80, '', ''),
(12, 'Stahl', 'Linda', 'žena', 'GER', 1.75, 78, '', ''),
(13, 'Ennis-Hill', 'Jessica', 'žena', 'GBR', 1.65, 57, '', ''),
(14, 'Černovová', 'Tatjana', 'žena', 'RUS', 1.89, 63, '', '');

